CREATE FUNCTION public.get_threat_type(description text) RETURNS text
    LANGUAGE plpgsql
    AS $$
BEGIN
    IF LOWER(description) LIKE '%malware%' THEN
        RETURN 'Malware';
    ELSIF LOWER(description) LIKE '%phishing%' THEN
        RETURN 'Phishing';
    ELSIF LOWER(description) LIKE '%ip%' THEN
        RETURN 'IP';
    ELSE
        RETURN 'Other';
    END IF;
END;
$$;


